import{o as e,c as a,b as r}from"./app.554cfa74.js";const g='{"title":"SwaggerHub使用教程","description":"SwaggerHub使用详细教程","frontmatter":{"title":"SwaggerHub使用教程","head":[["meta",{"name":"description","content":"SwaggerHub使用详细教程"}],["meta",{"name":"keywords","content":"swaggerhub swagger-ui swagger RESTful"}]]},"headers":[{"level":2,"title":"RESTful API是什么","slug":"restful-api是什么"},{"level":2,"title":"SwaggerHub是什么","slug":"swaggerhub是什么"},{"level":2,"title":"SwaggerHub","slug":"swaggerhub"},{"level":2,"title":"swagger-ui","slug":"swagger-ui"}],"relativePath":"front-end/swagger-hub/index.md","lastUpdated":1629646547745}',i={},t=[r('<h2 id="restful-api是什么"><a class="header-anchor" href="#restful-api是什么" aria-hidden="true">#</a> RESTful API是什么</h2><p>三句话：</p><ul><li>看Url就知道要什么</li><li>看http method就知道干什么</li><li>看http status code就知道结果如何</li></ul><p>举例：</p><ul><li>GET：用来获取资源</li><li>POST：用来新建资源（也可以用于更新资源）。比如：POST <code>http://api.com/friends/id</code>——添加好友</li><li>PUT：用来更新资源</li><li>DELETE：用来删除资源。比如：DELETE <code>http://api.com/friends/id</code>——删除某人的好友 （在http parameter指定好友id）</li><li>UPDATE：<code>http://api.qc.com/friends/id/profile</code>——更新个人资料</li></ul><h2 id="swaggerhub是什么"><a class="header-anchor" href="#swaggerhub是什么" aria-hidden="true">#</a> SwaggerHub是什么</h2><p>Swagger 是一个规范且完整的框架，用于生成、描述、调用和可视化 RESTful 风格的 Web 服务（可以简单理解为接口文档）。</p><p>Swagger旗下两款产品swagger-ui、swggerHub</p><h2 id="swaggerhub"><a class="header-anchor" href="#swaggerhub" aria-hidden="true">#</a> SwaggerHub</h2><p><a href="https://swaggerhub.com/help/index" target="_blank" rel="noopener noreferrer">官方文档地址</a></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Swagger需要后台服务来支持，暂停更新...</p></div><h2 id="swagger-ui"><a class="header-anchor" href="#swagger-ui" aria-hidden="true">#</a> swagger-ui</h2><p>在<a href="https://swagger.io/tools/swagger-ui/download/" target="_blank" rel="noopener noreferrer">官网首页</a>找到<code>swagger ui</code>，点击然后进入github下载<a href="https://github.com/swagger-api/swagger-ui" target="_blank" rel="noopener noreferrer">swagger项目</a></p>',13)];i.render=function(r,g,i,l,s,u){return e(),a("div",null,t)};export{g as __pageData,i as default};
